    console.log(this.props);
  }

  componentWillMount() {
    this.setState({
      columns: this.props.columns
    });
    console.log(this.props);
  }

  renderCells() {
    return this.state.columns.forEach(column => {
      console.log(column);
      column.map(num => console.log(num));
    });

    /* return this.state.columns[0].map(column =>
      column.map(num => <Cell key={column} text={num} />)
    ); */
  }

  render() {
    return <div className="gameBoard">{this.renderCells()}</div>;
  }
}

